import React from "react";

import TodoListItem from './todo-list-item';

const TodoList = (props) => {
    return(
        <ul>
            <li><TodoListItem label ="Drink Cofee"/></li>
            <li><TodoListItem label = "Build React App" important /></li>
        </ul>
    )
}

export default TodoList;
